import React from 'react'
import {NavLink} from 'react-router-dom'

const NavigationItem = (props) => {
    return(
        <NavLink to={props.link} exact={props.exact} style={{color: "#fff"}}>
            {props.children}
        </NavLink>
    )
}

export default NavigationItem
